import TodoList from './components/TodoList.js'
import {BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom'

function App() {
  return (
    <Router className="App">
      <nav className="txt">
      <Link to="/" > TodoList </Link> 
      </nav>
      <Routes className="route">
        <Route path="/"/>
      </Routes>
    </Router>
  );
}

export default App;
